### 2. Python 回測核心組件

#### 數學模型回測引擎
```python
class MathModelBacktester:
    def __init__(self, config: BacktestConfig):
        self.config = config
        self.price_generator = NormalDistributionPriceGenerator()
        self.monte_carlo_engine = MonteCarloEngine()

    def run_backtest(self, strategy: Strategy, params: dict) -> BacktestResult:
        # 生成基於正態分佈的價格序列
        prices = self.price_generator.generate_prices(
            initial_price=params['initial_price'],
            volatility=params['volatility'],
            drift=params['drift'],
            periods=params['periods']
        )

        # 執行策略回測
        return self._execute_strategy(strategy, prices)

class NormalDistributionPriceGenerator:
    def generate_prices(self, initial_price: float, volatility: float, 
                       drift: float, periods: int) -> np.ndarray:
        # 使用幾何布朗運動生成價格
        dt = 1/252  # 日頻率
        random_shocks = np.random.normal(0, 1, periods)
        returns = drift * dt + volatility * np.sqrt(dt) * random_shocks
        prices = initial_price * np.exp(np.cumsum(returns))
        return prices
```

#### 真實數據回測引擎
```python
class RealDataBacktester:
    def __init__(self, data_provider: DataProvider):
        self.data_provider = data_provider
        self.market_simulator = MarketSimulator()

    def run_backtest(self, strategy: Strategy, start_date: datetime, 
                    end_date: datetime) -> BacktestResult:
        # 獲取真實歷史數據
        market_data = self.data_provider.get_historical_data(
            start_date, end_date
        )

        # 模擬市場執行
        return self.market_simulator.simulate(strategy, market_data)

class MarketSimulator:
    def __init__(self):
        self.slippage_model = SlippageModel()
        self.commission_model = CommissionModel()

    def simulate_order_execution(self, order: Order, market_data: MarketData) -> ExecutionResult:
        # 考慮滑點和手續費的真實執行模擬
        execution_price = self.slippage_model.calculate_execution_price(
            order, market_data
        )
        commission = self.commission_model.calculate_commission(order)

        return ExecutionResult(
            executed_price=execution_price,
            commission=commission,
            timestamp=market_data.timestamp
        )
```

