### 4. CLI 控制介面

```rust
use clap::{App, Arg, SubCommand};

pub struct CLI {
    trading_core: Arc<TradingCore>,
    backtest_core: Arc<BacktestCore>,
}

impl CLI {
    pub async fn run(&self) -> Result<()> {
        let matches = App::new("量化交易機器人")
            .version("1.0")
            .subcommand(SubCommand::with_name("start")
                .about("啟動交易機器人"))
            .subcommand(SubCommand::with_name("stop")
                .about("停止交易機器人"))
            .subcommand(SubCommand::with_name("status")
                .about("查看系統狀態"))
            .subcommand(SubCommand::with_name("positions")
                .about("查看當前持倉"))
            .subcommand(SubCommand::with_name("backtest")
                .about("執行回測")
                .arg(Arg::with_name("strategy")
                    .required(true)
                    .help("策略文件路徑"))
                .arg(Arg::with_name("mode")
                    .possible_values(&["math", "real"])
                    .default_value("math")))
            .get_matches();

        match matches.subcommand() {
            ("start", _) => self.start_trading().await,
            ("stop", _) => self.stop_trading().await,
            ("status", _) => self.show_status().await,
            ("positions", _) => self.show_positions().await,
            ("backtest", Some(sub_m)) => {
                let strategy_path = sub_m.value_of("strategy").unwrap();
                let mode = sub_m.value_of("mode").unwrap();
                self.run_backtest(strategy_path, mode).await
            },
            _ => Ok(()),
        }
    }
}
```

