    #[error("訂單執行失敗: {0}")]
    OrderExecutionError(String),

    #[error("風險控制拒絕: {0}")]
    RiskControlError(String),

    #[error("策略載入錯誤: {0}")]
    StrategyLoadError(String),

    #[error("數據錯誤: {0}")]
    DataError(String),
}

pub type Result<T> = std::result::Result<T, TradingError>;
```

### 錯誤恢復機制
```rust
pub struct ErrorRecoveryManager {
    retry_policies: HashMap<ErrorType, RetryPolicy>,
    circuit_breakers: HashMap<String, CircuitBreaker>,
}

impl ErrorRecoveryManager {
    pub async fn handle_error(&self, error: &TradingError, context: &str) -> RecoveryAction {
        match error {
            TradingError::ExchangeConnectionError(_) => {
                // 嘗試重連，如果失敗則切換到備用交易所
                RecoveryAction::RetryWithFallback
            },
            TradingError::OrderExecutionError(_) => {
                // 記錄錯誤，停止相關策略
                RecoveryAction::StopStrategy
            },
            TradingError::RiskControlError(_) => {
                // 風險控制錯誤，立即停止所有交易
                RecoveryAction::EmergencyStop
            },
            _ => RecoveryAction::Log,
        }
    }
}
