#[cfg(test)]
mod tests {
    use super::*;
    use crate::{
        OrderManager, Order, OrderSide, OrderType, OrderStatus, OrderResponse, 
        ExchangeAdapter, Balance, Position, MarketData, TradingError, Result
    };
    use async_trait::async_trait;
    use std::sync::Arc;
    use tokio::sync::broadcast;
    use rust_decimal::Decimal;
    use chrono::Utc;
    use futures_util::Stream;
    use std::pin::Pin;

    /// 模擬交易所適配器用於測試
    #[derive(Debug, Clone)]
    struct MockExchangeAdapter {
        name: String,
        should_fail: bool,
    }

    impl MockExchangeAdapter {
        fn new(name: &str) -> Self {
            Self {
                name: name.to_string(),
                should_fail: false,
            }
        }

        fn with_failure(name: &str) -> Self {
            Self {
                name: name.to_string(),
                should_fail: true,
            }
        }
    }

    #[async_trait]
    impl ExchangeAdapter for MockExchangeAdapter {
        async fn place_order(&self, order: Order) -> Result<OrderResponse> {
            if self.should_fail {
                return Err(TradingError::OrderExecutionError("模擬下單失敗".to_string()));
            }

            Ok(OrderResponse {
                order_id: order.id,
                client_order_id: format!("client_{}", order.id),
                status: OrderStatus::New,
                filled_quantity: Decimal::ZERO,
                remaining_quantity: order.quantity,
                avg_price: None,
            })
        }

        async fn cancel_order(&self, order_id: &str) -> Result<()> {
            if self.should_fail {
                return Err(TradingError::OrderExecutionError("模擬撤單失敗".to_string()));
            }
            Ok(())
        }

        async fn get_balance(&self) -> Result<Vec<Balance>> {
            Ok(vec![])
        }

        async fn get_positions(&self) -> Result<Vec<Position>> {
            Ok(vec![])
        }

        async fn subscribe_market_data(&self, _symbols: Vec<String>) -> Result<Pin<Box<dyn Stream<Item = MarketData> + Send>>> {
            unimplemented!("測試中不需要實現")
        }

        fn exchange_name(&self) -> &str {
            &self.name
        }
    }

/// 創建測試用訂單
fn create_test_order(id: &str, exchange: &str) -> Order {
    Order {
        id: id.to_string(),
        symbol: "BTCUSDT".to_string(),
        side: OrderSide::Buy,
        order_type: OrderType::Market,
        quantity: Decimal::from(1),
        price: Some(Decimal::from(50000)),
        exchange: exchange.to_string(),
        strategy: "test_strategy".to_string(),
        timestamp: Utc::now(),
    }
}

#[tokio::test]
async fn test_order_manager_creation() {
    let order_manager = OrderManager::new();
    assert_eq!(order_manager.get_registered_exchanges().len(), 0);
    assert_eq!(order_manager.get_all_pending_orders().len(), 0);
}

#[tokio::test]
async fn test_add_remove_exchange() {
    let order_manager = OrderManager::new();
    let adapter = Arc::new(MockExchangeAdapter::new("binance"));

    // 測試添加交易所
    order_manager.add_exchange(adapter.clone());
    let exchanges = order_manager.get_registered_exchanges();
    assert_eq!(exchanges.len(), 1);
    assert!(exchanges.contains(&"binance".to_string()));

    // 測試移除交易所
    let removed = order_manager.remove_exchange("binance");
    assert!(removed.is_some());
    assert_eq!(order_manager.get_registered_exchanges().len(), 0);
}

#[tokio::test]
async fn test_place_order_success() {
    let order_manager = OrderManager::new();
    let adapter = Arc::new(MockExchangeAdapter::new("binance"));
    order_manager.add_exchange(adapter);

    let order = create_test_order("test_order_1", "binance");
    let result = order_manager.place_order(order.clone()).await;

    assert!(result.is_ok());
    let response = result.unwrap();
    assert_eq!(response.order_id, order.id);
    assert_eq!(response.status, OrderStatus::New);

    // 檢查訂單是否被記錄
    let status = order_manager.get_order_status(&order.id);
    assert_eq!(status, Some(OrderStatus::New));

    let pending = order_manager.get_pending_order(&order.id);
    assert!(pending.is_some());
}

#[tokio::test]
async fn test_place_order_exchange_not_found() {
    let order_manager = OrderManager::new();
    let order = create_test_order("test_order_2", "unknown_exchange");

    let result = order_manager.place_order(order).await;
    assert!(result.is_err());

    match result.unwrap_err() {
        TradingError::ExchangeNotFound(exchange) => {
            assert_eq!(exchange, "unknown_exchange");
        },
        _ => panic!("預期 ExchangeNotFound 錯誤"),
    }
}

#[tokio::test]
async fn test_place_order_failure() {
    let order_manager = OrderManager::new();
    let adapter = Arc::new(MockExchangeAdapter::with_failure("binance"));
    order_manager.add_exchange(adapter);

    let order = create_test_order("test_order_3", "binance");
    let result = order_manager.place_order(order.clone()).await;

    assert!(result.is_err());

    // 檢查訂單狀態是否被設置為拒絕
    tokio::time::sleep(tokio::time::Duration::from_millis(10)).await; // 等待狀態更新
    let status = order_manager.get_order_status(&order.id);
    assert_eq!(status, Some(OrderStatus::Rejected));
}

#[tokio::test]
async fn test_cancel_order_success() {
    let order_manager = OrderManager::new();
    let adapter = Arc::new(MockExchangeAdapter::new("binance"));
    order_manager.add_exchange(adapter);

    // 先下單
    let order = create_test_order("test_order_4", "binance");
    order_manager.place_order(order.clone()).await.unwrap();

    // 撤單
    let result = order_manager.cancel_order(&order.id).await;
    assert!(result.is_ok());

    // 檢查狀態更新（需要等待異步操作完成）
    tokio::time::sleep(tokio::time::Duration::from_millis(10)).await;
    let status = order_manager.get_order_status(&order.id);
    assert_eq!(status, Some(OrderStatus::Cancelled));
}

#[tokio::test]
async fn test_cancel_order_not_found() {
    let order_manager = OrderManager::new();
    let result = order_manager.cancel_order("nonexistent_order").await;

    assert!(result.is_err());
    match result.unwrap_err() {
        TradingError::OrderNotFound(order_id) => {
            assert_eq!(order_id, "nonexistent_order");
        },
        _ => panic!("預期 OrderNotFound 錯誤"),
    }
}

#[tokio::test]
async fn test_order_update_handling() {
    let order_manager = OrderManager::new();
    let adapter = Arc::new(MockExchangeAdapter::new("binance"));
    order_manager.add_exchange(adapter);

    // 訂閱訂單更新
    let mut rx = order_manager.subscribe_order_updates();

    // 下單
    let order = create_test_order("test_order_5", "binance");
    order_manager.place_order(order.clone()).await.unwrap();

    // 模擬訂單更新
    let update = crate::OrderUpdate {
        order_id: order.id.clone(),
        status: OrderStatus::Filled,
        filled_quantity: order.quantity,
        avg_price: Some(Decimal::from(50000)),
        timestamp: Utc::now(),
    };

    order_manager.handle_order_update(update.clone()).await;

    // 檢查是否收到更新事件
    let received_update = tokio::time::timeout(
        tokio::time::Duration::from_millis(100),
        rx.recv()
    ).await.unwrap().unwrap();

    assert_eq!(received_update.order_id, update.order_id);
    assert_eq!(received_update.status, OrderStatus::Filled);

    // 檢查訂單是否從待處理列表中移除
    let pending = order_manager.get_pending_order(&order.id);
    assert!(pending.is_none()); // 已完成的訂單應該被移除
}

    #[tokio::test]
    async fn test_order_statistics() {
        let order_manager = OrderManager::new();
        let adapter = Arc::new(MockExchangeAdapter::new("binance"));
        order_manager.add_exchange(adapter);

        // 下幾個訂單並更新狀態
        let order1 = create_test_order("order_1", "binance");
        let order2 = create_test_order("order_2", "binance");
        let order3 = create_test_order("order_3", "binance");

        order_manager.place_order(order1.clone()).await.unwrap();
        order_manager.place_order(order2.clone()).await.unwrap();
        order_manager.place_order(order3.clone()).await.unwrap();

        // 更新部分訂單狀態
        order_manager.handle_order_update(crate::OrderUpdate {
            order_id: order1.id,
            status: OrderStatus::Filled,
            filled_quantity: order1.quantity,
            avg_price: Some(Decimal::from(50000)),
            timestamp: Utc::now(),
        }).await;

        order_manager.handle_order_update(crate::OrderUpdate {
            order_id: order2.id,
            status: OrderStatus::Cancelled,
            filled_quantity: Decimal::ZERO,
            avg_price: None,
            timestamp: Utc::now(),
        }).await;

        let stats = order_manager.get_order_stats();
        assert_eq!(stats.total_count, 3);
        assert_eq!(stats.filled_count, 1);
        assert_eq!(stats.cancelled_count, 1);
        assert_eq!(stats.new_count, 1); // order3 仍然是 New 狀態
    }

    #[tokio::test]
    async fn test_multiple_exchanges() {
        let order_manager = OrderManager::new();

        // 添加多個交易所
